import React, { useContext } from 'react'
import { AuthContext } from './Auth'
function Home() {
    const { currentUser } = useContext(AuthContext);
    return (
        <div>
            <h1>You are logged in as {currentUser.email !== null ? currentUser.email : "boi"}!</h1>
        </div>
    )
}
export default Home
